import firstDog from "./img-react/dog-1.jpeg";
import secondDog from "./img-react/dog-2.jpeg";
import thirdDog from "./img-react/dog-3.jpeg";
function Blogs() {}
function App() {
  return (
    <div className="blogBoxes">
      <div className="box box-1">
        <img src={firstDog} alt="firstDog" height="400px" width="350px" />
        <h6>24 Jan 2024</h6>
        <h4>Finding your perfect dog breed...</h4>
        <button className="light-btn">Read more</button>
      </div>
      <div className="box box-2">
        {" "}
        <img src={secondDog} alt="secondDog" height="400px" width="350px" />
        <h6>24 Jan 2024</h6>
        <h4>Finding your perfect dog breed...</h4>
        <button className="light-btn">Read more</button>
      </div>
      <div className="box box-3">
        {" "}
        <img src={thirdDog} alt="thirdDog" height="400px" width="350px" />
        <h6>24 Jan 2024</h6>
        <h4>Finding your perfect dog breed...</h4>
        <button className="light-btn">Read more</button>
      </div>
    </div>
  );
}

export default App;
